import React, { Component } from "react";
import { Tabs, Tab, Grid, Cell } from "react-mdl";
import { Animation } from "mdbreact";
import ProjectCard from "./projectcard";

class Projects extends Component {
  constructor(props) {
    super(props);
    this.state = { activeTab: 0 };
  }

  toggleCategories() {
    if (this.state.activeTab === 0) {
      return (
        // Project 1
        <Animation type="fadeInLeft">
          {/* // Project 1 */}
          <div className="projects-grid" style={{ paddingTop: "20px" }}>
            <ProjectCard
              cardTitle="Stock Dashboard"
              cardText="A user inputs a stock ticker symbol on our custom HTML page, and the program will then fetch, clean, and display the relvant stock data. The program will also save past user searches in a databse."
              github="https://github.com/mlee0416/Stock"
              demo="https://stock123.herokuapp.com/"
              image="url(https://static-news.moneycontrol.com/static-mcnews/2018/01/BSE_Sensex_Budget_2017_volatile1-770x433.jpg) center / cover"
            />
            {/* // Project 2 */}
            <ProjectCard
              cardTitle="NFL Dashboard"
              cardText="A user inputs a stock ticker symbol on our custom HTML page, and the program will then fetch, clean, and display the relvant stock data. The program will also save past user searches in a databse."
              github="https://github.com/mlee0416/Stock"
              demo="https://stock123.herokuapp.com/"
              image="url(http://www.picks.org/wp-content/uploads/2014/10/img_0439.jpg) center / cover"
            />
            {/* // Project 3 */}
            <ProjectCard
              cardTitle="Movie Searcher"
              cardText="A user inputs a stock ticker symbol on our custom HTML page, and the program will then fetch, clean, and display the relvant stock data. The program will also save past user searches in a databse."
              github="https://github.com/mlee0416/Movie-Search"
              demo="https://stock123.herokuapp.com/"
              image="url(https://icdn3.digitaltrends.com/image/avengers-11.jpg?ver=1) center / cover"
            />
          </div>
        </Animation>
      );
    } else if (this.state.activeTab === 1) {
      return (
        <div>
          <h1>This is React</h1>
        </div>
      );
    } else if (this.state.activeTab === 2) {
      return (
        <div>
          <h1>This is JavaScript</h1>
        </div>
      );
    } else if (this.state.activeTab === 3) {
      return (
        <div>
          <h1>This is Python</h1>
        </div>
      );
    } else if (this.state.activeTab === 4) {
      return (
        <div>
          <h1>This is Tableau</h1>
        </div>
      );
    } else if (this.state.activeTab === 5) {
      return (
        <div>
          <h1>This is MySQL</h1>
        </div>
      );
    }
  }

  render() {
    return (
      <div>
        <Tabs
          activeTab={this.state.activeTab}
          onChange={tabId => this.setState({ activeTab: tabId })}
          ripple
        >
          <Tab>Featured Projects</Tab>
          <Tab>React</Tab>
          <Tab>JavaScript</Tab>
          <Tab>Python</Tab>
          <Tab>Tableau</Tab>
          <Tab>MySQL</Tab>
        </Tabs>
        <Grid>
          <Cell col={12}>
            <div className="content">{this.toggleCategories()}</div>
          </Cell>
        </Grid>
      </div>
    );
  }
}
export default Projects;
